        function showTab(type) {
            document.querySelectorAll('.tab').forEach(t => t.classList.remove('active'));
            document.querySelectorAll('.content').forEach(c => c.classList.remove('active'));
            document.querySelector('.tab.' + type).classList.add('active');
            document.getElementById(type + '-content').classList.add('active');
        }

        function createCard(sample, type) {
            const card = document.createElement('div');
            card.className = 'card';
            card.id = type + '-' + sample.idx;

            const label = labels[type][sample.idx];
            if (label === 1) card.classList.add('labeled-yes');
            if (label === 0) card.classList.add('labeled-no');

            card.innerHTML = `
                <img src="data:image/png;base64,${sample.image}" alt="${sample.det_id}">
                <div class="card-info">
                    <span class="card-id">${sample.det_id} | ${sample.tile_id}</span>
                    <span class="card-area">${sample.area_px.toLocaleString()} px</span>
                </div>
                <div class="card-info">
                    <div class="buttons">
                        <button class="btn btn-yes" onclick="setLabel('${type}', ${sample.idx}, 1)">Yes</button>
                        <button class="btn btn-no" onclick="setLabel('${type}', ${sample.idx}, 0)">No</button>
                        <button class="btn btn-skip" onclick="setLabel('${type}', ${sample.idx}, -1)">Skip</button>
                    </div>
                </div>
            `;
            return card;
        }

        function setLabel(type, idx, value) {
            labels[type][idx] = value;
            const card = document.getElementById(type + '-' + idx);
            card.classList.remove('labeled-yes', 'labeled-no');
            if (value === 1) card.classList.add('labeled-yes');
            if (value === 0) card.classList.add('labeled-no');
            updateCounts();
            saveToLocalStorage();
        }

        function updateCounts() {
            // Per-page counts
            const mkLabeled = Object.values(labels.mk).filter(v => v !== -1 && v !== undefined).length;
            const hspcLabeled = Object.values(labels.hspc).filter(v => v !== -1 && v !== undefined).length;
            document.getElementById('mk-labeled').textContent = mkLabeled;
            document.getElementById('hspc-labeled').textContent = hspcLabeled;

            // Update global counts
            updateGlobalCounts();
        }

        function updateGlobalCounts() {
            // Load all page labels across ALL slides and sum up global counts
            let globalMK = 0;
            let globalHSPC = 0;

            // Scan ALL localStorage keys for any slide pages
            for (let i = 0; i < localStorage.length; i++) {
                const key = localStorage.key(i);
                if (key && key.startsWith('unified_labels_') && key.includes('_page')) {
                    const pageLabels = localStorage.getItem(key);
                    if (pageLabels) {
                        try {
                            const parsed = JSON.parse(pageLabels);
                            globalMK += Object.values(parsed.mk || {}).filter(v => v !== -1 && v !== undefined).length;
                            globalHSPC += Object.values(parsed.hspc || {}).filter(v => v !== -1 && v !== undefined).length;
                        } catch(e) {}
                    }
                }
            }

            document.getElementById('mk-global').textContent = globalMK;
            document.getElementById('hspc-global').textContent = globalHSPC;
        }

        function saveToLocalStorage() {
            localStorage.setItem('unified_labels_2025_11_18_FGC2_page1', JSON.stringify(labels));
        }

        function saveLabels() {
            saveToLocalStorage();
            showToast('Labels saved to browser');
        }

        function exportLabels() {
            const exportData = {
                slide: '2025_11_18_FGC2',
                page: 1,
                mk: { labels: labels.mk, samples: mkSamples.map(s => ({ idx: s.idx, tile_id: s.tile_id, det_id: s.det_id })) },
                hspc: { labels: labels.hspc, samples: hspcSamples.map(s => ({ idx: s.idx, tile_id: s.tile_id, det_id: s.det_id })) }
            };
            const blob = new Blob([JSON.stringify(exportData, null, 2)], { type: 'application/json' });
            const url = URL.createObjectURL(blob);
            const a = document.createElement('a');
            a.href = url;
            a.download = 'unified_labels_2025_11_18_FGC2_page1.json';
            a.click();
            showToast('Labels exported');
        }

        function showToast(msg) {
            const toast = document.getElementById('toast');
            toast.textContent = msg;
            toast.style.display = 'block';
            setTimeout(() => toast.style.display = 'none', 2000);
        }

        // Initialize grids
        const mkGrid = document.getElementById('mk-grid');
        const hspcGrid = document.getElementById('hspc-grid');

        mkSamples.forEach(s => mkGrid.appendChild(createCard(s, 'mk')));
        hspcSamples.forEach(s => hspcGrid.appendChild(createCard(s, 'hspc')));

        updateCounts();
    </script>
